import React from 'react';
import styled from 'styled-components';

const MainItemBlock = styled.div`
  display: flex;
  margin-top: 50px;
  .h1 {
    font-size: 100px;
    color: black;
  }
`;

const MainItem = ({ item }) => {
  const {
    stateDt,
    decideCnt,
    deathCnt,
    examCnt,
    clearCnt,
    resutlNegCnt,
    careCnt,
    accExamCnt,
  } = item;

  return <div>hello</div>;
};

export default MainItem;
